import React from 'react'
import styled from 'styled-components'

const Menu = ({ menuItem }) => {
    return (
        <MenuStyled>
            {
                menuItem.map((item) => {
                    return (
                        <div key={item.id} className='grid-item'>
                            <div className='portfolio-content'></div>
                        </div>
                    )
                })
            }
        </MenuStyled>
    )
}

const MenuStyled = styled.div`

`;

export default Menu
